import { Component } from '@angular/core';

@Component({
  selector: 'app-a-cerca-de',
  templateUrl: './a-cerca-de.component.html',
  styleUrls: ['./a-cerca-de.component.css']
})
export class ACercaDeComponent {

}

<div class="fotoYnombre_div" style="display: flex;">
    <img src="./../../../assets/img/profile-pic.png" alt="fotoPerfil" style="width: 150px; margin-left: 5%; margin-top: -75px">
    <h1>FEDERICO SANCHEZ</h1>
</div>

<div class="container acerca">
    <h2>A CERCA DE MI:</h2>
    <p>Soy una persona sociable a la que le gusta compartir con la familia y amigos, me gusta trabajar en grupo. 
        Realizo deportes en general futbol.<br>
        Tambien me gusta hacer trekking y todo lo que conlleve un desafio.

    </p>
</div>
